; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 38.61 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 4781 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 239.86 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 110.16 s &lt;/li&gt;\n&lt;li&gt; transfer time: 3.52 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.2.171:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 3072 &lt;/li&gt;\n          &lt;li&gt; Memory: 21.59 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"formatter":{"id":"1473"},"group":null,"major_label_policy":{"id":"1474"},"ticker":{"id":"1127"}},"id":"1126","type":"LinearAxis"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1060","type":"BoxAnnotation"},{"attributes":{},"id":"1198","type":"CategoricalTicker"},{"attributes":{"tools":[{"id":"1267"},{"id":"1268"},{"id":"1269"}]},"id":"1270","type":"Toolbar"},{"attributes":{"data":{"cpu":{"__ndarray__":"AAAAAAAAOEAAAAAAAMBMQGZmZmZmZjlAZmZmZmamSUAAAAAAAAA2QAAAAAAAADxAAAAAAAAAOkAAAAAAAAAyQAAAAAAAADJAAAAAAAAASEAAAAAAAABAQAAAAAAAACRAAAAAAAAAAEAAAAAAAAAYQAAAAAAAgFJAAAAAAAAAAEAzMzMzMzM+QDMzMzMz80JAAAAAAAAAOkAAAAAAAAA0QAAAAAAAADRAAAAAAAAAREAAAAAAAAA+QDMzMzMz80hAAAAAAAAANkAAAAAAAAAQQAAAAAAAACBAZmZmZmaGUEAAAAAAAAAAQDMzMzMzs0VAAAAAAACAM0AAAAAAAAA4QAAAAAAAADJAAAAAAAAAPEAAAAAAAAA4QAAAAAAAADRAAAAAAAAARkAAAAAAAAAwQAAAAAAAACRAAAAAAAAAAEAAAAAAAABPQAAAAAAAABhAMzMzMzOzRkAAAAAAAAAqQAAAAAAAAEBAAAAAAAAAPkAAAAAAAAAyQAAAAAAAADBAAAAAAAAAOkAAAAAAA
